"description": "A Memorandum of Understanding (MOU) between the State of Alaska and the Province of British Columbia on Protection of Transboundary Waters. The MOU establishes a Bilateral Working Group to address concerns related to existing or proposed mine development, operations, closure, and long-term maintenance that could cause significant degradation of water quality or fisheries in the Alsek, Stikine, Taku and Unuk watersheds and marine waters."
